svg.script:
function showTooltip(evt, series, date, value) {
    var tooltip = document.getElementById('tooltip');
    var tooltipBg = document.getElementById('tooltip-bg');
    var tooltipText = document.getElementById('tooltip-text');

    while (tooltipText.firstChild) tooltipText.removeChild(tooltipText.firstChild);

    var lines = [series, date, 'Value: ' + value];
    for (var i = 0; i < lines.length; i++) {
        var tspan = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
        tspan.textContent = lines[i];
        tspan.setAttribute('x', 0);  // <-- relative to <text>
        tspan.setAttribute('dy', i === 0 ? '1em' : '1.2em');
        if (i === 0) tspan.setAttribute('font-weight', 'bold');
        tooltipText.appendChild(tspan);
    }

    var bbox = tooltipText.getBBox();
    var padding = 6;

    tooltipBg.setAttribute('width', bbox.width + padding * 2);
    tooltipBg.setAttribute('height', bbox.height + padding * 2);

    // Position tooltip near mouse
    var pt = evt.target.ownerSVGElement.createSVGPoint();
    pt.x = evt.clientX; pt.y = evt.clientY;
    var svgP = pt.matrixTransform(evt.target.ownerSVGElement.getScreenCTM().inverse());

    var x = svgP.x + 10;
    var y = svgP.y - bbox.height - 10;
    if (x + bbox.width + padding * 2 > evt.target.ownerSVGElement.width.baseVal.value)
        x = svgP.x - bbox.width - padding * 2 - 10;
    if (y < 0) y = svgP.y + 10;

    tooltipBg.setAttribute('x', x);
    tooltipBg.setAttribute('y', y);

    tooltipText.setAttribute('x', x + padding);   // <-- now aligned with rect
    tooltipText.setAttribute('y', y + padding + 10);

    tooltip.setAttribute('opacity', 1);
}


function hideTooltip() {
    document.getElementById('tooltip').setAttribute('opacity', 0);
}
